// eslint-disable-next-line
import React from "react";
import "./Navbar.css";
// import * as Icons from "react-icons/fa";

function Navbar() {
  return (
    <>
      <div className="navbar">
        <div
          className="container-fluid"
          style={{ backgroundColor: "aliceblue" }}
        >
          <h1>hello</h1>
        </div>
      </div>
    </>
  );
}

export default Navbar;
